// Products.js

import React from 'react';
import { Link } from 'react-router-dom';
import './Products.css';
import productsData from './productsData'; // Assuming productsData is your array of product information

function Products() {
  return (
    <div className="products">
      <h2>PRODUCTS</h2>
      <div className="products-grid">
        {productsData.map(product => (
          <Link key={product.id} to={`/products/${product.id}`} className="product-item">
            <img src={product.image} alt={product.name} className="product-image" />
            <div className="product-details">
              <h3>{product.name}</h3>
              <p className="product-price">{product.price}</p>
              <p className="product-reviews">Reviews: {product.reviews}</p>
              <button className="add-to-cart-btn">ADD TO CART</button>
            </div>
          </Link>
        ))}
      </div>
    </div>
  );
}

export default Products;
